'use strict';

/**
* Number of minutes in a week.
*
* @module @stdlib/time/constants/minutes-in-week
* @type {integer32}
*
* @example
* var MINUTES_IN_WEEK = require( '@stdlib/time/constants/minutes-in-week' );
* // returns 10080
*/


// MAIN //

/**
* The number of minutes in a week is given by
*
* ``` tex
* 60 \cdot 24 \cdot 7 = 10080
* ```
*
* @constant
* @type {integer32}
* @default 10080
*/
var MINUTES_IN_WEEK = 10080|0; // asm type annotation


// EXPORTS //

module.exports = MINUTES_IN_WEEK;
